dict.string:
# Clear stale elements from cache and update info.plist

query="$1"

log() {
  echo "$@" >&2
}

fatal() {
  echo -n "$@"
  log "$@"
  exit 1
}


log "."
log "Cleaning caches ..."
./searchio clean 1>&2
ok=$?
[[ $ok -ne 0 ]] && {
  fatal "searchio clean failed: $ok"
}

log "Updating info.plist ..."
./searchio reload 1>&2
ok=$?
[[ $ok -ne 0 ]] && {
  fatal "searchio reload failed: $ok"
}

# Update info.plist

log() {
  echo "$@" >&2
}

fatal() {
  echo -n "$@"
  log "$@"
  exit 1
}


log "."
log "Updating info.plist ..."
./searchio reload 1>&2
ok=$?
[[ $ok -ne 0 ]] && {
  fatal "searchio reload failed: $ok"
}
